column4:
Якщо ви не користуєтеся додатком кілька місяців:

• дозволи буде скасовано, щоб захистити ваші дані;
• показ сповіщень буде припинено, щоб заощаджувати заряд акумулятора;
• тимчасові файли буде видалено, щоб звільнити місце на диску.

Щоб відновити дозволи й показ сповіщень, відкрийте додаток.
